create table rng_document_types
(
    idrref       varchar(35)  not null
        constraint rng_document_types_pkey
            primary key,
    version      varchar(36)  not null,
    marked       varchar(5)   not null,
    predefinedid varchar(35)  not null,
    parentidrref varchar(35)  not null,
    folder       varchar(5)   not null,
    code         numeric(26)  not null,
    description  varchar(100) not null,
    fld7618      varchar(2),
    fld7859      varchar(250),
    fld532       varchar(36),
    uuid         varchar(40)  not null
);

alter table rng_document_types
    owner to postgres;

